import React from 'react';
import logo from './logo.svg';
import './App.css';
import {Helmet} from "react-helmet";
import ContentLoader from "react-content-loader"
class App extends React.Component {
  render()
  {
  return (
    <div>
<Helmet>
<title>Here's the Title!</title>
    <meta name="description" content="This is what you want to show as the page content in the Google SERP Listing" />
</Helmet>
    <ContentLoader
    height={560}
    width={408}
    speed={2}
    primaryColor="#f3f3f3"
    secondaryColor="#ecebeb"
  >
    <rect x="0" y="15" rx="0" ry="0" width="117" height="16" />
    <rect x="70" y="35" rx="3" ry="3" width="85" height="6" />
    <rect x="0" y="80" rx="3" ry="3" width="350" height="6" />
    <rect x="0" y="100" rx="3" ry="3" width="380" height="6" />
    <rect x="0" y="120" rx="3" ry="3" width="201" height="6" />
  </ContentLoader>

  </div>
  );
}
}
export default App;
